import React from 'react'
import styled from 'styled-components/native' 


export default function Menu() {
  return(
    <Container>
      <Title>Menu</Title>
    </Container>
  )
}

const Container = styled.View`
  flex: 1;
  justify-content: center;
  align-items: center;
  background-color: #e8f0ff;
  padding-top: 10px;
` 

const Title = styled.Text`

`
